import React from 'react'
import ReactDOM from 'react-dom'


import Container from '../prototypes/prototype_7/Container'


document.addEventListener('DOMContentLoaded', () => {
  const container = document.getElementById('prototype_7')
  const frame = document.createElement('div')
  const header = document.createElement('h1')
  const button = document.getElementsByClassName('SC_Button')
  console.log(button)
  header.textContent = 'Sound rec ord 001';
  header.classList.add('header')
  frame.classList.add('plast')
  ReactDOM.render(<Container />, container)
  container.appendChild(frame)
  container.appendChild(header)

  button.addEventListener('click', () => {
    frame.classList.add('plast_animation')
  })

})
